long long s[100000000];
bool num[100000000]={0};
int a=0;
int n;
int i,j;
void screen(int n){
	for(i=2;i<=n;i++){
		if(!num[i]) 
			s[a++]=i;
		for(j=0;j<a&&i*s[j]<=n;j++){
			num[i*s[j]]=1; 
			if(i%s[j]==0)  
				break;
		}
	}
}
